  false,\n\t\"url\": null,\n\t\"notes\": \"This paper deals with methods for deterring
  birds from oil spill areas. This subject has been exhaustively reviewed by Koski
  and Richardson (1976) and succinctly summarized by Ward (1977). My remarks will
  be limited to those techniques which may be most suitable for dispersing seabirds
  in Alaska's coastal and offshore waters. The marine environment is being emphasized
  because of (1) the greater likelihood of a major oil spill affecting large numbers
  of birds, and (2) the almost complete lack of knowledge of the effectiveness of
  the various deterrents in dispersing marine birds. Presented at Leadership Oiled-Bird
  Rehabilitation Workshop, Anchorage, Alaska, November 14-15, 1978.\",\n\t\"owner_org\":
